summary.label:
Электронная версия каталога песен для караоке-систем AST. Поддерживаемые модели: AST-250, AST-50, AST-100, AST Mini.
Возможности:
- иллюстрированный каталог исполнителей;
- поиск песен по номеру, названию, исполнителю, тексту;
- фильтрация результатов поиска по языкам, форматам, жанрам;
- мгновенный доступ к любимым жанрам;
- составление списка избранных песен, синхронизация списка между устройствами;
- прослушивание оригинала песни.
